  const baseUrl = "/v1/files/{id}";
  import type {File} from "../models/File"


  const urlBuilder = (base: string, items: Record<string, unknown>) => {
    let newUrl = baseUrl
    for (const key in items) {
      newUrl = newUrl.replaceAll(`{${key}}`, `${items[key]}`)
    }

    return base + newUrl
  }

export const update_file = async (token: string, baseUrl: string, params: {
  "id": string;"name"?: string;"parent_folder_id"?: string;"on_duplicate"?: string;"lock_at"?: undefined;"unlock_at"?: undefined;"locked"?: boolean;"hidden"?: boolean;"visibility_level"?: string
}) => {
  console.log(token)
  const r = await fetch(urlBuilder(baseUrl, params), {
    headers: {
      "Authorization": "Bearer " + token
    }
  })
  if(r.status != 200) {
    console.error(r)
    return undefined
  }
  return (await r.json()) as File
}
